body {
    text-align: center;
    font-size: 20px;
    padding: 2.5%;
    font-family: 'Montserrat', sans-serif;
    font-weight:400;
}
.headShot {
    width: 400px;
    height: 400px;
    overflow: hidden;
    border-radius: 200px;
}
.title-fade-out {
    opacity: 0;
    animation-name: fade-out;
    animation-duration: 2s;
}
.title-fade-in {
    opacity: 100;
    animation-name: fade-in;
    animation-duration: 2s;
}

@keyframes fade-out {
    from { opacity : 100 }
    to {opacity : 0}
}
@keyframes fade-in {
    from { opacity : 0 }
    to {opacity : 110}
}
